INSERT INTO `customer_seller_conversations` (`id`, `customer_id`, `seller_id`, `sender_role`, `message`, `files`, `is_seen`, `source`, `created_at`, `updated_at`) VALUES
(624, 1, 1, 'customer', '\"Berapa harga laptop?\"', NULL, 0, 'web', '2025-06-26 09:19:46', '2025-06-26 09:19:46'),
(625, 1, 1, 'chatbot', 'Hai! 😊 Untuk memberi Anda informasi harga laptop yang tepat, saya membutuhkan detail lebih jelas ya, seperti merek atau model laptop yang Anda maksud. Laptop memiliki berbagai jenis dan harga yang bervariasi—dari Rp500 ribuan hingga ratusan juta tergantung merek, spesifikasi, ukuran penyimpanan, dan fitur lainnya. Apakah bisa Anda sebutkan merek atau model laptop tertentu? 😊 Misalnya, apakah Lenovo, ASUS, HP, MacBook, atau merk lain? Jika ada tautan produk juga membantu. Selain itu, saya bisa informasikan bahwa beberapa brand sering memiliki promo menarik di minggu ini! 💻✨.', NULL, 1, 'web', '2025-06-26 09:21:52', '2025-06-26 09:22:59'),
(626, 1, 3, 'customer', '\"Produk apa yang bagus untuk kulit kering?\"', NULL, 0, 'web', '2025-06-26 09:22:58', '2025-06-26 09:22:58'),
(627, 1, 1, 'customer', 'Berapa harga laptop lenovo?', NULL, 0, 'web', '2025-06-26 09:23:29', '2025-06-26 09:23:29'),
(628, 1, 3, 'chatbot', 'Untuk kulit kering, saya rekomendasikan SKINTIFIC\n- 5X Ceramide Barrier Moisturizer Gel! 😊 Produk ini diformulasikan dengan kombinasi unik dari Ceramide, Hyaluronic Acid, dan Niacinamide yang dirancang untuk membantu melembabkan, mengembalikan kelembaban, memperbaiki barier kulit, serta mencerahkan kulit wajah. Selain itu juga mengandung Centella yang dapat menenangkan kulit. Produk ini cocok digunakan sebagai pelembap sehari-hari dan aman digunakan di siang hari maupun malam hari karena formula ringannya tidak akan membuat pori-pori tersumbat. 😊 Selain itu, produk ini sudah terdaftar BPOM sehingga terjamin keamanannya. Kalau Budi ingin tahu lebih detail mengenai kandungan atau manfaatnya, atau ada pertanyaan lain, silakan langsung chat admin saya! 🌟', NULL, 1, 'web', '2025-06-26 09:25:08', '2025-06-26 09:25:26'),
(629, 1, 3, 'customer', '“Bagaimana cara pakainya?”', NULL, 0, 'web', '2025-06-26 09:25:44', '2025-06-26 09:25:44'),
(630, 1, 1, 'chatbot', 'Untuk informasi harga terkini dari produk Lenovo Yoga Slim 7i 14IMH9, saat ini harganya adalah Rp. 1.639.920 (setelah diskon). Harga aslinya sebelumnya adalah Rp. 20.499.000, dengan diskon spesial mencapai 8% OFF. Berikut detail produk tersebut:\n- Merek: Lenovo\n- Model: Yoga Slim 7i 14IMH9 (Luna Grey)\n- Spesifikasi utama: Intel Core Ultra 7 155H Evo Win11, 16GB RAM, 1TB SSD, layar 14\" WUXGA OLED dengan teknologi DCI-P3 dan touch screen.\n- Fitur unggulan: Tipis, desain mewah, baterai tahan lama, serta dukungan WiFi6E. Harganya kini lebih terjangkau! Ada promo spesial juga nih. Jika ada model lain yang Anda cari atau ingin penjelasan tambahan, silakan sebutkan ya 😊', NULL, 1, 'web', '2025-06-26 09:27:01', '2025-06-26 09:27:40'),
(631, 1, 1, 'customer', '\"Yang itu spesifikasinya apa?\"', NULL, 0, 'web', '2025-06-26 09:27:38', '2025-06-26 09:27:38'),
(632, 1, 3, 'chatbot', 'Untuk menggunakan produk SKINTIFIC 5X Ceramide Barrier Moisturizer Gel secara tepat dan mendapatkan hasil terbaik, ikuti petunjuk berikut: \n1. Cara Penggunaan:\n- Ambil secukupnya krim kecil pada telapak tangan atau aplikator.\n- Oleskan tipis-tipis merata di wajah yang telah dibersihkan dan dilakukan toning. \n2. Frekuensi:\n- Gunakan setiap hari, pagi dan malam hari. \n3. Tips:\n- Aplikasikan saat kulit terasa kering atau setelah mandi untuk hasil optimal.\n- Dapat digunakan sebagai pelembap harian sebelum makeup juga. Anda bisa menggunakan produk ini dengan rutin untuk mendapatkan manfaat terbaik! ☀️🌙 Jika ada pertanyaan lain, silakan chat admin saya ya 😊', NULL, 1, 'web', '2025-06-26 09:29:22', '2025-06-26 09:29:23'),
(633, 1, 1, 'chatbot', '😊 Mohon maaf, saya tidak bisa memberi tahu spesifikasi produk karena belum jelas merk atau model yang Anda maksud. Bisa tolong sebutkan nama produknya lebih spesifik? Misalnya, “laptop”, “smartphone”, atau “TV” 😊', NULL, 0, 'web', '2025-06-26 09:31:05', '2025-06-26 09:31:05'),
(634, 1, 10, 'customer', 'Produk dengan kamera terbaik apa?', NULL, 0, 'web', '2025-06-26 09:31:54', '2025-06-26 09:31:54'),
(635, 1, 10, 'chatbot', 'Saya mengerti Anda mencari produk dengan kamera terbaik! 😊 Namun, dalam informasi yang kami miliki saat ini, belum ada detail spesifik tentang model atau merek kamera. Untuk memberikan rekomendasi yang tepat, mungkin Anda bisa berbagi sedikit lebih banyak soal kebutuhan Anda? Misalnya:\n- Apakah Anda memerlukan kamera DSLR (seperti Canon EOS 200D II atau Sony Alpha a6100) untuk hasil foto profesional?\n- Atau, apakah ini seputar smartphone dengan kamera terbaik seperti iPhone 15 Pro Max? Kalau Anda mengacu pada produk dari Toko 10 yang tersedia di sini, saya bisa merekomendasikan beberapa ponsel populer dengan fitur kamera unggulan:\n- Xiaomi 14T: Dilengkapi dengan kamera AI yang mendukung foto berkualitas tinggi dan mode potret. Cocok buat penggemar fotografi! 📸\n- Apple iPhone 15 (varian tertinggi): Kamera Pro yang mumpuni, cocok untuk hasil jepretan profesional. Kalau Anda bisa memperjelas, saya siap bantu carikan rekomendasi terbaik sesuai kebutuhan! 📱✨.', NULL, 1, 'web', '2025-06-26 09:34:34', '2025-06-26 09:40:50'),
(636, 1, 10, 'customer', 'Mana yang lebih bagus untuk foto malam?', NULL, 0, 'web', '2025-06-26 09:41:25', '2025-06-26 09:41:25'),
(637, 1, 10, 'chatbot', 'Untuk hasil foto malam yang lebih baik, saya menyarankan Apple iPhone 15 atau Xiaomi 14T, karena kamera pada produk elektronik ini memiliki fitur AI dan kemampuan untuk mengambil foto dengan pencahayaan rendah. Namun, perlu diingat bahwa hasilnya akan lebih optimal jika Anda menggunakan kamera DSLR (tidak ada rekomendasi dalam daftar saat ini). Apakah Anda ingin merekomendasikan model yang tepat berdasarkan kebutuhan spesifik? 😊', NULL, 1, 'web', '2025-06-26 09:43:13', '2025-06-26 09:48:44');
