(27, '3dUL-GVtaAlqs-RzFT', 102, 10, NULL, NULL, 7, 8, 'Valar DryWeave Men’s Long Sleeve - Moss Green, M', 'valar-dryweave-mens-long-sleeve---moss', '449000.00000000', 10529.00000000, 0, NULL, '0.00000000', '68304544f40f81747993924.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! Valar DryWeave Men’s Long Sleeve - Moss Green, M</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>The Valar DryWeave is the first athletic shirt for athletes in Indonesia with anti-bacterial technology.- Using real silver (Ag) yarn woven into the fabric, it combats odor-causing bacteria and keeps you fresh all day.- The all-new One-Way Transport (OWT) is the latest moisture wicking technology using proprietary knitting technique that allows instant absorption of sweat and helps you feel drier on the skin side.- The Valar DryWeave has great breathability, allowing athlete to feel comfortable and cool even during hot weather.Valar DryWeave is proudly designed and made in Indonesia.--Valar DryWeave adalah kaos atletik pertama untuk atlet di Indonesia dengan teknologi anti-bakteri.- Menggunakan benang perak (Ag) asli yang ditenun ke dalam kain, kaos ini memerangi bakteri penyebab bau badan dan membuat Anda tetap segar sepanjang hari.- One Way Transport (OWT) adalah teknologi penyerapan keringat terbaru yang menggunakan teknik merajut khusus untuk penyerapan keringat secara instan dan membantu Anda merasakan kering di sisi kulit.- Valar DryWeave memiliki \'pernafasan kain\' yang hebat, dan memungkinkan atlet untuk merasa nyaman dan sejuk bahkan selama cuaca panas.Valar DryWeave dengan bangga di desain dan di buat di Indonesia.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '68304544f40f81747993924.jpg', NULL, NULL, 1, 1, 1, 1, 1, 0, 0.00000000, 4490, NULL, 1, NULL, '2025-05-23 09:52:05', '2025-05-23 09:52:05');
