minuman, susu, sarang burung dan sebagainya.2. pendinginan semikonduktor, suhu pendinginan di bawah suhu sekitar sekitar 15 ℃ (suhu pendinginan terendah sekitar 5 ℃ atau lebih), suhu pemanasan hingga sekitar 60 ℃.3. lemari es dilengkapi dengan kipas pendingin, kipas akan mengeluarkan suara kecil sekitar 40 desibel saat bekerja.✅ Penggunaan:1. Mulai pendinginan: sesuaikan sakelar geser ke posisi paling atas, mulai pendinginan, lampu indikator hijau menyala2. Mulai pemanasan: atur sakelar geser ke posisi terendah, pendinginan dan pemanasan dimulai, lampu indikator merah menyala3. OFF: Mengatur sakelar geser ke posisi tanda OFF tengah.📜 Peringatan：1. Anda harus mematikan daya setidaknya selama 15 menit sebelum beralih dari pendinginan ke pemanasan atau dari pemanasan ke pendinginan.2. Daya harus dicabut sebelum dibersihkan3. Jangan memasukkan kotak pendingin dan pemanas atau kabel listrik ke dalam cairan. Gosok dengan sabun netral dan lap basah.4. Jangan gunakan lemari es untuk membuat es!5 Jangan menghalangi ventilasi atau lemari es akan lebih cepat panas dan menyebabkan kebakaran!📦 Daftar kemasan:1 x Mini Fridge1 x Rak kecil1 x Adaptor (perangkat)1 x Kabel Daya Otomotif DC1 x Panduan pengguna📌 【Kebijakan Pertukaran & Pengembalian Dana】Kami mengizinkan pertukaran dan pengembalian dana dalam waktu 7 hari kerja setelah menerima barang yang rusak.* Jika Anda memiliki pertanyaan, silakan hubungi saya melalui layanan pelanggan segera.💗 Terima kasih & Happy shopping 💗Jangan Lupa Bintang 5 ⭐⭐⭐⭐⭐.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '68304567d4bf51747993959.jpg', NULL, NULL, 1, 346, 1, 1, 1, 0, 0.00000000, 8400, NULL, 1, NULL, '2025-05-23 09:52:39', '2025-05-23 09:52:39'),
(30, '6plH-YDTnCUsj-TrRe', 102, 10, NULL, NULL, 13, 14, 'SOMETHINC AHA BHA PHA Peeling Solution 20ml', 'somethinc-aha-bha-pha-peeling-solution-20ml', '114000.00000000', 18085.00000000, 0, NULL, '0.00000000', '68304579266de1747993977.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! SOMETHINC AHA BHA PHA Peeling Solution 20ml</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>AHA BHA PHA Peeling SolutionSerum eksfoliasi dengan kandungan AHA, BHA, BHA yang dapat mengangkat sel kulit mati, membereskan masalah pori-pori tersumbat & komedo, serta menjaga kelembaban kulit.Ukuran: 20 mlNo BPOM: NA18200100487Manfaat:- Membantu membersihkan pori-pori tersumbat- Mengangkat sel-sel kulit mati- Menyamarkan bekas jerawat- Membantu mencerahkan kulit- Menjaga kelembaban kulitHero Ingredients:- Glycolic Acid (3% AHA): Bekerja dibawah lapisan kulit epidermis dengan melarutkan sel-sel kulit mati, kotoran, serta minyak yang tertimbun dapat terangkat keluar.- Salicylic Acid (1% BHA): Meratakan tekstur kulit, membersihkan pori-pori kulit, mengatasi komedo, jerawat, & mengontrol produksi minyak- Lactobionic Acid (2% PHA): Bersifat humectant(menjaga kadar air dalam kulit) sehingga mampu melembabkan dan membuat kulit tetap kenyal serta glowing.- Niacinamide: Melembabkan kulit, membantu mengatasi hiperpigmentasi, membantu meredakan kemerahan & jerawat yang meradang, serta membantu meratakan tekstur kulit.- Panthenol/Vitamin B5: Membantu memperbaiki tekstur kulit, mengurangi resiko dehidrasi pada kulit, & memiliki sifat yang anti-inflammatory sehingga cocok untuk kulit eczema, jerawat, serta sedang iritasi- Daucus Carota Leaf Extract: Melindungi kulit dari kerusakan akibat sinar matahari, sekaligus mencegah penuaan dini, kulit kering, & jerawat- Hibiscus Sabdariffa Extract: Membantu mencerahkan wajah, mengangkat komedo, menyamarkan flek hitam & melindungi kulit dari penuaan dini.Jenis kulit: semua jenis kulit mulai dari usia 11 tahun</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '68304579266de1747993977.jpg', NULL, NULL, 1, 3, 1, 1, 1, 0, 0.00000000, 1140, NULL, 1, NULL, '2025-05-23 09:52:57', '2025-05-23 09:52:57'),
(31, '4a3D-vlCoTTtc-xQ9v', 102, 10, NULL, NULL, 13, 14, 'DOJAKO TONER 100ML MENGECILKAN PORI-PORI Skincare Refreshing Nourishtoner Mengencangkan Wajah Melembutkan Mencerahkan - Mini 100ml', 'dojako-toner-100ml-mengecilkan-pori-pori-skincare-refreshing', '69000.00000000', 13383.00000000, 0, '33810.00000000', '51.00000000', '6830458a9261b1747993994.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! DOJAKO TONER 100ML MENGECILKAN PORI-PORI Skincare Refreshing Nourishtoner Mengencangkan Wajah Melembutkan Mencerahkan - Mini 100ml</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>NEW DOJAKO CLEAR AND SKIN TONER 100 MLToner dengan cairan berwarna merah muda, memiliki tekstur yang elastis, aroma mawar ringan, serta mudah dioleskan di wajah. Efektif mengisi kelembaban kulit, mengecilkan pori-pori, menjadikan kulit lembut, halus, menyegarkan, dan tidak berminyak. Aman digunakan untuk bumil dan busui. Dengan volume 100 ML bisa digunakan sampai 1-2 bulan pemakaian.BPOM NA11221201193Manfaat:Melembabkan dan melembutkan kulitMengecilkan pori-poriMengencangkan kulitMengangkat sel-sel kulit matiHero Ingredients:Butylene Glycol : Melembabkan wajah, terutama untuk pemilik kulit kering atau wajah berjerawatPropylene Glycol : mampu mengurangi munculnya bintik-bintik yang ada di kulitCyclopentasiloxane : melindungi dari kulit keringCara penggunaan:Setelah pembersihan dan pengencangan, oleskan secukupnya pada dahi, pipi, ujung hidung, dan dagu. Lalu usapkan secara melingkar dengan jari tengah dan jari manis, dan tepuk-tepuk sebentar secara merata. Toner bisa digunakan di pagi dan malam hari.Untuk hasil yang lebih maksimal, ikuti step berikut:Sabun Cuci Muka - Toner - Serum - Cream - SunblockCocok untuk jenis kulit keringKomposisi:WATER, BUTYLENE GLYCOL, PROPYLENE GLYCOL, CYCLOPENTASILOXANE, ISOPROPYL PALMITATE, METHYLPARABEN, PEG-40 HYDROGENATED CASTOR OIL, ACRYLATES/C10- 30 ALKYL ACRYLATE CROSSPOLYMER, ARGININE, HONEY EXTRACT, MANNITOL, TOCOPHERYL ACETATE, PARFUM, SODIUM HYALURONATE, CYCLODEXTRIN, YEAST EXTRACT, SODIUM CITRATE, DISODIUM EDTA, GLYCERYL CAPRYLATE, CAPRYLHYDROXAMIC ACID, CI 14700Perhatian:Hindari area mata, apabila produk tidak disengaja, segera bersihkan dengan air.Simpan di tempat yang sejuk dan kering. Letakkan pada tempat yang tidak dapat dijangkau oleh anak-anak.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '6830458a9261b1747993994.jpg', NULL, NULL, 1, 2, 1, 1, 1, 0, 0.00000000, 690, NULL, 1, NULL, '2025-05-23 09:53:14', '2025-05-23 09:53:14'),
(32, 'qSTd-g6IlHsOW-CLv5', 102, 10, NULL, NULL, 13, 14, 'La Roche-Posay Serum Pure Retinol B3 Wajah Serum 30ml - Anti Penuaan - 30ml', 'la-roche-posay-serum-pure-retinol-b3-wajah', '690000.00000000', 15481.00000000, 0, '213900.00000000', '69.00000000', '6830459bf046c1747994011.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! La Roche-Posay Serum Pure Retinol B3 Wajah Serum 30ml - Anti Penuaan - 30ml</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>La Roche-Posay Pure Retinol Face Serum with Vitamin B3 SerumUntuk melindungi hak dan kepentingan konsumen, toko kami dapat memberikan pemeriksaan faktur pembelian resmi. Jika Anda memerlukan faktur, silakan hubungi layanan pelanggan untuk memintanya.Serum wajah dan leher anti penuaan dengan retinol murni ini membuat kulit terasa lebih halus, terhidrasi, dan diperbarui. Hasilnya, tampilan garis, kerutan, dan kerusakan dini akibat sinar matahari berkurang. Serum retinol ini menggabungkan retinol murni pekat dan vitamin B3 untuk efektivitas optimal sekaligus cocok untuk kulit sensitif.- [x] Diuji oleh Dokter Kulit- [x] Cocok untuk Kulit Sensitif- [x] Cocok untuk Mata Sensitif- [x] Bebas Paraben- [x] Bebas Minyak- [x] Teruji Alergi- [x] Non-KomedogenikFungsi utama1. KONSENTRASI ANTI KERUTAN3. MEMPERBARUI4. PELAYARAN KEMBALIDirekomendasikan untuk* Kerutan, garis halus* Kerusakan akibat sinar matahari dini* Kulit sensitifCara Penggunaan1. Isi penetes dengan serum dan oleskan 3-4 tetes di malam hari pada wajah dan leher2. Terapkan setelah pembersihan. Gunakan serum retinol sebelum mengoleskan pelembab.3. Selalu gunakan tabir surya sehari setelah penggunaan.4. Retinol murni dapat bereaksi saat kontak dengan udara, menguning. Ini tidak merusak toleransi atau kemanjurannya.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '6830459bf046c1747994011.jpg', NULL, NULL, 1, 50, 1, 1, 1, 0, 0.00000000, 6900, NULL, 1, NULL, '2025-05-23 09:53:32', '2025-05-23 09:53:32'),
(33, '7CYf-zLpY04yy-NaOv', 102, 10, NULL, NULL, 13, 14, 'Estetiderma Skin Brightening Vitamin C Serum – Serum pagi antioksidan melindungi dan mencerahkan kulit kusam Pencerah Tetes Wajah - Skin Brightening Vitamin C', 'estetiderma-skin-brightening-vitamin-c-serum-serum', '120960.00000000', 10681.00000000, 0, NULL, '0.00000000', '683045ae1c2d21747994030.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! Estetiderma Skin Brightening Vitamin C Serum – Serum pagi antioksidan melindungi dan mencerahkan kulit kusam Pencerah Tetes Wajah - Skin Brightening Vitamin C</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Sekarang isi produk ini 15ml agar lebih hemat dan awet dipakai! Estetiderma Skin Brightening Vitamin C Serum, dengan kandungan antioksidan dari vitamin C, berfungsi untuk membantu mencerahkan, mengurangi flek hitam pada wajah dan mencegah penuaan dini.Fungsi:- Menyamarkan flek dan noda hitam- Mencerahkan kulit wajah secara keseluruhan sehingga terlihat glowing- Mencegah penuaan dini (anti aging)Cara pakai: Aplikasikan 3-4 tetes serum pada wajah dan leher secara merata di pagi hari sebelum memakai sunscreen.Isi 15ml. BPOM NA18221901065. Halal MUI 17150051371019.----------Estetiderma adalah merek klinik kecantikan dan skincare yang telah berdiri sejak tahun 1997. Semua skincare kami diformulasikan pakar dermatologi, telah teregistrasi BPOM dan Halal, dan cocok digunakan untuk pria maupun wanita.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '683045ae1c2d21747994030.jpg', NULL, NULL, 1, 76, 1, 1, 1, 0, 0.00000000, 1200, NULL, 1,