(34, '5pPM-DcQeGppC-Hjfq', 102, 10, NULL, NULL, 13, 14, '[FREE SPATULA] EILEEN GRACE - Moisturize Rose Jelly Mask 300 ml | Masker / skincare jerawat I Kulit kering sensitif | Bekas jerawat | Kemerahan | Bruntusan | Bopeng - 300ml', 'free-spatula-eileen-grace---moisturize-rose', '399000.00000000', 14232.00000000, 0, '339150.00000000', '15.00000000', '683045c12e1351747994049.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! [FREE SPATULA] EILEEN GRACE - Moisturize Rose Jelly Mask 300 ml | Masker / skincare jerawat I Kulit kering sensitif | Bekas jerawat | Kemerahan | Bruntusan | Bopeng - 300ml</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Moisturize Rose Jelly Mask 300mlMasker dengan tekstur jelly. Kandungan utama Bulgarian Rose, Hyaluronic Acid, Centella Asiatica, Honey, Vitamin C. Bisa digunakan oleh semua jenis kulit (Normal, berjerawat, kusam, kering & berminyak, Sensitif).Detail :1. Plant-based, bebas alkohol, dan bebas paraben2. Bersertifikat SGS Internasional, ECOCERT & GMP Taiwan3. Aman digunakan untuk kulit sensitif, iritasi, berjerawat, ibu hamil dan menyusuiManfaat :Acne treatment - Bantu redakan, sembuhkan jerawat, dan bruntusanBrighten skin - Mencerahkan kulit & menyamarkan bekas jerawat kemerahanHydrates skin - Meningkatkan kelembapan kulitCalms skin - Redakan kemerahan akibat jerawatCara penggunaan :Pemakaian masker bisa digunakan setiap hari.Di aplikasikan rata ke seluruh wajah. Setelah di diamkan paling lama 20 menit, di kikis secara perlahan lalu bilas dengan air.Ingredients:Water, Carbomer, Propanediol, Acrylates/C10-30 Alkyl Acrylate Crosspolymer, Hydrolyzed Adansonia Digitata Extract, Honey Extract, Hyaluronic Acid, Triethanolamine, Chlorphenesin,  PPG-1-PEG-9 Lauryl Glycol Ether, PEG-40 Hydrogenated Castor Oil, Coceth-7, Rosa Gallica Flower Powder, Parfum, Ascorbic Acid, Aloe Vera Extract, Ruscus Aculeatus Root Extract, Hydrolyzed Yeast Protein, Chondrus Crispus (Carrageenan) Extract, Butylene Glycol, Ammonium Glycyrrhizate, Panthenol, Escin, Centella Asiatica Extract, Calendula Officinalis Flower Extract, Sodium Hyaluronate.No. BPOM NA47180206320</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '683045c12e1351747994049.jpg', NULL, NULL, 1, 9, 1, 1, 1, 0, 0.00000000, 3990, NULL, 1, NULL, '2025-05-23 09:54:09', '2025-05-23 09:54:09'),
(35, '4oWE-7WYwG4CH-CMgr', 102, 10, NULL, NULL, 13, 14, 'La Roche Posay Mela B3 Niacinamide Serum 30ml - Mencerahkan Noda Hitam', 'la-roche-posay-mela-b3-niacinamide-serum', '780000.00000000', 13246.00000000, 0, '764400.00000000', '2.00000000', '683045d47f9e71747994068.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! La Roche Posay Mela B3 Niacinamide Serum 30ml - Mencerahkan Noda Hitam</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>La Roche Posay MelaB3 Serum - Mencerahkan Noda HitamSerum MelaB3 dengan kandung yang berfungsi untuk mencerahkan noda hitam & mencerahkan kulit. Aman digunakan untuk kulit sensitif dan keringCARA PAKAI:- Gunakan pada pagi dan malam hari untuk wajah dan leher.- Disarankan untuk menggunakan perlindungan SPF 15 untuk pagi/siang hari untuk mengoptimalkan kinerja sunscreen dalam melindungi kulit dari radikal bebas.TEKSTUR SERUM RINGAN:- Cepat meresap- Melembapkan</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '683045d47f9e71747994068.jpg', NULL, NULL, 1, 102, 1, 1, 1, 0, 0.00000000, 7800, NULL, 1, NULL, '2025-05-23 09:54:28', '2025-05-23 09:54:28'),
(36, '7yg6-4xfizvHe-QYoc', 102, 10, NULL, NULL, 13, 14, 'Estetiderma Day & Night Serum Duo - Paket serum wajah pagi dan malam - Bright Vit C, Skin Refining', 'estetiderma-day-night-serum-duo---paket', '209440.00000000', 17607.00000000, 0, '188496.00000000', '10.00000000', '683045e706b081747994087.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! Estetiderma Day & Night Serum Duo - Paket serum wajah pagi dan malam - Bright Vit C, Skin Refining</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Day & Night Serum Duo adalah paket dengan 2 serum untuk membantu mencerahkan dan meremajakan kulit wajah. Rangkaian ini cocok untuk semua jenis kulit.Isi paket:Skin Brightening Vitamin C Serum (15ml), serum pagi yang mencerahkan dengan kandungan antioksidan dari Vitamin CSkin Refining Serum (15ml), serum malam anti aging dengan bahan aktif Glycolic Acid / AHA (10.5%)Fungsi:- Mencerahkan warna kulit yang kusam- Menyamarkan flek dan noda hitam- Mencegah penuaan dini (anti aging)- Kulit jadi lebih cerah, halus dan glowingCara pakai:Di pagi hari - Aplikasikan 3-4 tetes Skin Brightening Vitamin C Serum pada wajah dan leher yang sudah dibersihkan secara merata, lalu tunggu hingga kering sebelum mengaplikasikan pelembap/sunscreen.Di malam hari - Aplikasikan 3-4 tetes Skin Refining Serum pada wajah dan leher yang sudah dibersihkan secara merata, lalu tunggu hingga kering sebelum mengaplikasikan pelembap.Perhatian: Aplikasikan sunscreen di pagi/siang hari untuk melindungi kulit. Jika pertama kali pakai, lakukan patch test terlebih dahulu. Mulai dengan seminggu sekali dahulu dan tingkatkan frekuensi pemakaian secara perlahan.Isi 2 x 15ml. BPOM NA18221901065. Halal MUI 17150051371019 dan BPOM NA18221901066. Halal MUI 17150051371019.----------Estetiderma adalah merek klinik kecantikan dan skincare yang telah berdiri sejak tahun 1997. Semua skincare kami diformulasikan pakar dermatologi, telah teregistrasi BPOM dan Halal, dan cocok digunakan untuk pria maupun wanita.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '683045e706b081747994087.jpg', NULL, NULL, 1, 176, 1, 1, 1, 0, 0.00000000, 2090, NULL, 1, NULL, '2025-05-23 09:54:47', '2025-05-23 09:54:47'),
