inan dgn rempah pala dan kapulaga.Sangat praktis, mudah, lezat dan sehat. 300 gr beras basmati premium, bumbu rempah home made fresh dibuat pada saat pemesanan dan kismis, bisa untuk 4-5 porsi.HalalTanpa MSGTanpa PengawetTanpa PewarnaKenapa beras basmati?Beras Basmati berasal dr pegunungan himalaya yg membentang antara india dan pakistan.Beras ini mengandung nutrisi tinggi dan rendah gula shg baik di konsumsi u/ menjaga kesehatan terutama bagi penderita obesitas, diabetes dan jantungVarian bumbu :1. Nasi Kebuli : Menonjolkan Rasa Kapulaga dan Pala2. Nasi Biryani : Menonjolkan Rasa Kayu Manis3. Nasi Kabsah : Menonjolkan Rasa Jinten4. Nasi Mandy : Menonjolkan Rasa Kari5. Nasi Bukhori : Menonjolkan Rasa Lada Hitam6. NasGor Kambing7. NasGor Mesir</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '683046e538dfe1747994341.jpg', NULL, NULL, 1, 50, 1, 1, 1, 0, 0.00000000, 480, NULL, 1, NULL, '2025-05-23 09:59:01', '2025-05-23 09:59:01'),
