(52, 'brsU-6pVTy4Jv-dlz1', 102, 10, NULL, NULL, 24, 25, 'PONNI Rice Gold - Beras Kukus Ponni - Khas India LOW GI Grade A++ Food Nasi Diet', 'ponni-rice-gold---beras-kukus-ponni', '90000.00000000', 11477.00000000, 0, '67500.00000000', '25.00000000', '6830471e54fd71747994398.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! PONNI Rice Gold - Beras Kukus Ponni - Khas India LOW GI Grade A++ Food Nasi Diet</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>KEMASAN BARU 2 KG   #34;Another Quality Product from The House of Shukriya” Rettai Kili adalah seri Baru Merek Shukriya Untuk Beras Kukus dari India untuk Beras Ponni yang terkenal kategori Gold Class. Memiliki Medium Glikemik Indeks (Rendah Dalam skala Medium GI) baik untuk diet dan pengidap Diabetes.  Cara Memasaknya sama seperti nasi pada umumnya, cuci beberapa kali dan rendam selama 30 menit sangat di rekomendasikan untuk hasil yang terbaik. Sesuaikan air dengan 1 cup beras ponni yaitu 2 - 3 kali di rice cooker karena hasilnya akan berbeda-beda setiap jenis modelnya.   ============================================================================  Rettai Kili is Shukriya’s series for Ponni Rice from India for famous Ponni Rice brand in Gold Class. Medium GI on lower side of Medium GI rice for avoiding weight gain or Diabities.   Cooks like normal rice, washing few times and soaking for 1/2 hour is highly recommended for best results. Adjust water 1 cup rice to water 2-3 times in Rice Cooker as result differ from model to model.   Untuk info Nutrisi bisa geser gambar foto2 produk.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '6830471e54fd71747994398.jpg', NULL, NULL, 1, 460, 1, 1, 1, 0, 0.00000000, 900, NULL, 1, NULL, '2025-05-23 09:59:58', '2025-05-23 09:59:58'),
