(55, 'XmQX-ALximtmK-dcE1', 102, 10, NULL, NULL, 24, 25, 'Bumbu Bunda Elia BB Rice Beras BB 200 g - Beef Steak', 'bumbu-bunda-elia-bb-rice-beras-bb', '49999.00000000', 18884.00000000, 0, NULL, '0.00000000', '68304754c9c281747994452.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! Bumbu Bunda Elia BB Rice Beras BB 200 g - Beef Steak</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Merupakan beras asli Indonesia yang sudah dicampurkan dengan rempah-rempah, sayur asli, dan juga daging asli.Varian BB Rice :1. Beef Steak : Beras, Daging Sapi, Wortel, Bawang Putih2. Chicken Cream Soup : Beras, Ayam, Seledri,Wortel3. Chicken Tuna : Beras, Ayam , Tuna, Non Dairy Creamer, Bawang Putih, Brokoli, Bawang Perai, Wortel, Keju4. Chicken Soto : Beras, Ayam, Kari, Jeruk Nipis, Wortel, Seledri, Bawang Merah, Bawang Putih,5. Butter Cheese : Beras, Keju, Non Diary Creamer, Bawang Putih, Seledri, Wortel, Brokoli6. Beef Salmon : Beras, Daging Sapi, Salmon, Bawang Putih, Bawang Perai, Wortel, Bayam7. Beef Curry : Beras, Daging Sapi, Kari, Jeruk Nipis, Bawang Merah, Seledri, Wortel, Bawang PutihCara Memasak:1.Beras sudah dalam kondisi bersih, jadi tidak perlu dicuci lagi- 6+ bulan: 2-3 sdm + air 100-200 ml- 10+ bulan: 3-4 sdm + air 200-300 mlIsi : 200 Gram</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '68304754c9c281747994452.jpg', NULL, NULL, 1, 9, 1, 1, 1, 0, 0.00000000, 490, NULL, 1, NULL, '2025-05-23 10:00:52', '2025-05-23 10:00:53'),
(56, '1ZsO-QGygb3mT-d80k', 102, 10, NULL, NULL, 30, 31, '[1 PACK] MAKUKU SAP Diapers Comfort Fit Extra Jumbo+4 Pants/Tape M/L/XL Popok Bayi Tipis Extra Dry Anti Gumpal Mengunci Cairan - M42 + 4 Pants', '1-pack-makuku-sap-diapers-comfort-fit', '88300.00000000', 18364.00000000, 0, NULL, '0.00000000', '68304766e0d301747994470.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! [1 PACK] MAKUKU SAP Diapers Comfort Fit Extra Jumbo+4 Pants/Tape M/L/XL Popok Bayi Tipis Extra Dry Anti Gumpal Mengunci Cairan - M42 + 4 Pants</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>MAKUKU SAP Diapers Comfort Fit : #AntiGumpal Nyaman MaksimalINFORMASI PRODUKSeries : MAKUKU SAP Diapers Comfort Fit JumboTipe popok : Popok Bayi CelanaUkuran : M/L/XLIsi : 1 Pack isi 38 - 42 +4 pcs6 TEKNOLOGI INTI DALAM COMFORT FIT MINI(1) Tipis & Lembut: Permukan ekstra lembut, cegah iritasi kulit si Kecil.(2) Daya Tampung: Efektif menghisap cairan hingga 400ML(3) Anti Gumpal: Menyerap urin secara merata & bebas osmosis(4) Ekstra Kering: Mengunci cairan secara maksimal, permukaan tetap kering hingga 8 jam(5) Desain U-Shape: Perlindungan area pusar dari peradangan (khusus ukuran NB)(6) Permukaan Rongga Udara: Sirkulasi lebih lancar, cegah risiko bocor bagian bawah popok#MAKUKUSAPDiapers #MAKUKUAntiGumpal #MAKUKUSuperTipisSuperNyerap #PopokAntiGumpal #MAKUKUComfortFitMini</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '68304766e0d301747994470.jpg', NULL, NULL, 1, 721, 1, 1, 1, 0, 0.00000000, 880, NULL, 1, NULL, '2025-05-23 10:01:10', '2025-05-23 10:01:11'),
(57, 'oJPQ-0r22hLsq-mHH0', 102, 10, NULL, NULL, 30, 31, 'POOKIO SS Popok Anak Diaper NB - XXXXL  (FREE Clean Plus Tissue Travelpack 70 Sheets) - Perekat NB', 'pookio-ss-popok-anak-diaper-nb--', '65300.00000000', 12330.00000000, 0, '55505.00000000', '15.00000000', '683047789d9751747994488.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! POOKIO SS Popok Anak Diaper NB - XXXXL  (FREE Clean Plus Tissue Travelpack 70 Sheets) - Perekat NB</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Pookio SS Diapers adalah popok premium terbaik untuk si kecil. Dengan ketipisan hanya 2mm menjadikan popok Pookio sangat nyaman dan aman untuk si kecil, namun tetap berdaya serap tinggi.* Crystal LockMembuat popok mampu menampung dan mengunci cairan hingga menyeluruh dan mencegah terjadinya kebocoran.* Natural Extracts & AntibacterialMengandung natural extract sehingga aman pada kulit sensitif si kecil dan bebas dari bakteri.* Super Lembut, kering & Menyerap SempurnaLapisan dalam popok yang selembut kapas membuat si kecil tetap nyaman.* Sirkulasi Luar DalamMemungkinkan udara bersirkulasi bebas walau popok telah terisi penuh, sehingga popok akan tetap kering dan mencegah ruam.* Indikator UrineIndikator pada popok yang akan berubah warna ketika popok telah terisi penuh, memudahkan moms mengetahui kapan waktunya mengganti popok si kecil.* Elastic Soft RubberKaret pada popok akan melekat lembut pada pinggang si kecil, sehingga popok tidak mengikat dan menyebabkan kemerahan pada kulit si kecil.* Disposable TapeSetiap popok Pookio tipe Pants akan dilengkapi dengan Disposable Tape untuk memudahkan moms membuang popok sehingga tetap bersih.Size tersedia:NB - XXXXLCara Pakai :1. Bukalah lipatan popok, pastikan bagian popok yang bergambar berada di bagian luar2. Pakaikan popok kepada si Kecil seperti mengenakan celana3. Pastikan lingkar kaki dan pinggang telah terpakai dengan pas dan tidak terlipat untuk mencegah kebocoran.Cara Melepaskan & Membuang:1. Sobek popok pada sisi lipatan samping. Buang kotoran ke dalam toilet2. Gulung popok dengan bagian bergambar menghadap  keluar. Rekatkan gulungan popok dengan perekat pada bagian belakang popok. Buang ke tempat sampah tertutup dan jangan membuang popok ke dalam toilet.Cobalah ukuran yang lebih besar bila:* Popok terlalu ketat hingga membuat bagian pinggang dan kaki si Kecil menjadi merah karena karet  popok.* Pipis dan feses terlihat terlalu banyak menumpuk.*Tanggal yang tertera pada produk adalah tanggal produksi dan tanggal expired. Produk aman digunakan sampai dengan 3 tahun setelah tanggal produksi.** !!PENTING!!Sangat disarankan agar pembeli dapat merekam video saat pembukaan paket. Tanpa adanya bukti video, akan sangat sulit bagi kami untuk memproses keluhan Anda.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '683047789d9751747994488.jpg', NULL, NULL, 1, 49, 1, 1, 1, 0, 0.00000000, 650, NULL, 1, NULL, '2025-05-23 10:01:28', '2025-05-23 10:01:28'),
(58, '92Mw-MlS2eP1V-Xnfy', 102, 10, NULL, NULL, 30, 31, 'Sweety Bronze Pants Dry X-pert M 48s - Popok Bayi Celana / Baby Pants Diaper - Bronze Pants, Standar', 'sweety-bronze-pants-dry-x-pert-m-48s', '92669.00000000', 15494.00000000, 0, '68575.06000000', '26.00000000', '6830478a7b4a81747994506.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! Sweety Bronze Pants Dry X-pert M 48s - Popok Bayi Celana / Baby Pants Diaper - Bronze Pants, Standar</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Detail:- Popok Bayi Tipe Celana- Ukuran M (7-12kg)Isi:- 1 bag Sweety Bronze Pants Dry X-pert M 48sSweety Bronze Dry X-pert Pants Baru!- Dengan teknologi Smart Leak Lock, yang dapat menyerap cepat & mengunci cairan dengan sempurna, kering hingga 12 jam- Didukung dengan SAP Bacteria Control yang dapat mencegah tumbuhnya bakteri, sehingga kulit si Kecil tetap kering dan sehat- Dibuat dengan bahan popok bersirkulasi udara, selembut kapas, sehingga cegah lembab, cegah iritasi membuat si Kecil nyaman, bebas bergerak dalam kondisi apapun- Mempunyai perlindungan 360 derajat yang elastis dan lembut, tidak menimbulkan bekas kemerahan pada kulit bayi___TANGGAL YANG TERTERA DI KEMASAN ADALAH TANGGAL PRODUKSI, BUKAN TANGGAL EXIPIREDTANGGAL EXPIRED 3 TAHUN DARI TANGGAL PRODUKSIKetentuan Komplain Produk:- Menyertakan video unboxing dari awal sampai akhir proses unboxing tanpa terputus- Produk MASIH TERSEGEL, DALAM KEADAAN UTUH dan BELUM DIGUNAKAN- Apabila produk telah digunakan, artinya customer SETUJU dengan produk yang diterima dan tidak dapat mengajukan komplainNote: \"Sedang dalam proses pergantian kemasan, produk dikirim random\"</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '6830478a7b4a81747994506.jpg', NULL, NULL, 1, 121, 1, 1, 1, 0, 0.00000000, 920, NULL, 1, NULL, '2025-05-23 10:01:46', '2025-05-23 10:01:46'),
(59, 'Lw7p-kKRAjzvl-T0z6', 102, 10, NULL, NULL, 30, 31, '[FLASH SALE] Merries Premium L22 Carton - Popok Bayi Celana (9-14)kg', 'flash-sale-merries-premium-l22-carton--', '1027800.00000000', 10256.00000000, 0, '626958.00000000', '39.00000000', '6830479c48db11747994524.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! [FLASH SALE] Merries Premium L22 Carton - Popok Bayi Celana (9-14)kg</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Merries Premium L22 Carton - Popok Bayi Celana (9-14)kgTerdiri atas :6x Merries Premium L22  - Popok Bayi / Baby Diapers / Pempes Perekat / Tape [isi 132 Buah]Popok celana dengan sirkulasi udara baik, menjaga kulit bayi tetap kering dan nyaman. Pemenang Good Design Award untuk kenyamanan saat dipakai (*Award di Jepang 2016)1. Permukaan bergelombangDengan permukaan bergelombang, udara dapat mengalir diantara popok dan kulit dan menyerap kotoran lunak bayi kecil dan menahan agar tidak menyebar sehingga kulit bayi tetap kering2. Terowongan UdaraTeknologi yang unik yang membungkus pinggang bayi dengan lembut, membantu melepaskan lembab sehingga kulit bayi tetap kering.3. Karet Popok Lembut, Nyaman, Pas MenyeluruhKaret pinggang terasa pas, lembut dan nyaman. Tidak terasa mengganjal, tidak mudah melorot, dengan posisi tetap tertahan di pinggang.4. Daya Serap Tinggi dan Tidak BocorMenyerap pipis seketika dan menguncinya, serta mencegah kebocoran hingga pagi.5. Alarm Penanda PipisMerries memiliki teknologi penanda pipis yang akan berubah warna apabila popok sudah terisi penuh1. Masukkan kedua tangan Anda ke dalam popok tipe pants yang akan dipakaikan pada bayi Anda melalui lubang bagian paha dan dengan lembut pasangkan popok tersebut pada bayi Anda. Cara demikian memudahkan kaki bayi masuk ke dalam popok. * Jika Anda memakaikan popok tipe pants dengan posisi bayi berdiri, pastikan bayi Anda dapat menopang badannya saat dipakaikan. Rentangkan popok tipe pants agar terbuka dan pakaikan seperti memakaikan celana dalam biasa dimana kaki dimasukkan ke popok satu per satu.2. Lalu tarik bagian pinggang popok ke atas hingga menutupi pusar bayi.3. Atur gather di bagian pinggang agar pas dan pastikan gather di bagian paha tidak terlipat ke dalam.* Gunakan jari tangan Anda untuk mengatur gather di bagian dalam untuk mencegah terjadinya bocor.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '6830479c48db11747994524.jpg', NULL, NULL, 1, 3, 1, 1, 1, 0, 0.00000000, 10270, NULL, 1, NULL, '2025-05-23 10:02:04', '2025-05-23 10:02:04'),
