(66, 'tdDv-1Y5fF5C3-qHO2', 102, 10, NULL, NULL, 35, 36, 'RETICOR 0.025% CREAM ISI 15GR / TRETINOIN/ SALEP JERAWAT / OBAT-OBATAN SALEP JERAWAT', 'reticor-0025-cream-isi-15gr-tretinoin-salep', '24510.00000000', 14991.00000000, 0, NULL, '0.00000000', '6830481a410da1747994650.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! RETICOR 0.025% CREAM ISI 15GR / TRETINOIN/ SALEP JERAWAT / OBAT-OBATAN SALEP JERAWAT</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>DeskripsiRETICOR CREAM merupakan obat jerawat yang mengandung Tretinoin. Obat ini digunakan untuk mengurangi jumlah jerawat dan mempercepat penyembuhan jerawat. Tretinoin merupakan retinoid yang bekerja dengan cara mempengaruhi pertumbuhan pergantian sel kulit. DIndikasi UmumAkne vulgaris. Meredakan komedo, papul dan pustulKomposisiTretinoin (Retinoic Acid) 0.025%DosisPENGGUNAAN OBAT INI HARUS SESUAI DENGAN PETUNJUK DOKTER. Gunakan 1 kali sehari pada malam hariAturan PakaiOleskan pada bagian kulit atau bagian yang sakit sesuai dengan aturan pakai. Jangan digunakan untuk luka terbuka kecuali obat memang diperuntukkan pada luka terbukaPerhatianHARUS DENGAN RESEP DOKTER. Hindari kontak dengan mata, hidung, tenggorokan, dan membran mukosa; pemaparan berlebihan terhadap sinar matahari. Produk yang mengandung alkohol berkadar tinggi. Hamil dan laktasiKontra IndikasiHipersensitivitas. Eksimakut, rosaseaEfek SampingKulit kemerahan, hiperpigmentasi atau hipopigmentasi, fotosensitivitasGolongan ProdukObat Keras (Merah)KemasanDus, Tube @ 15 GManufakturGenero PharmaceuticalNo. RegistrasiBPOM: DKL0635802129A1Note :*Apabila pesanan sudah sampai mohon dapat dicek kelengkapannya serta kondisi produk yang diterima sebelum klik pesanan selesai*Pesanan yang sudah di klik selesai tidak bisa di batalkan dan di return dengan alasan apapun.*Mohon buat Video Unboxing saat paket Diterima & Dibuka, kami tidak menerima komplain jika barang rusak/salah/kurang tanpa Video Unboxing*Pengembalian tidak dapat diproses apabila segel produk sudah terbuka.*Pengecekan batch akan dilakukan untuk memastikan barang tersebut di beli dari Century Official Store.*Dengan membeli produk di toko Century Official Store maka customer menyetujui prosedur ini.*Selamat berbelanja di Century Official Store.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '6830481a410da1747994650.jpg', NULL, NULL, 1, 2, 1, 1, 1, 0, 0.00000000, 240, NULL, 1, NULL, '2025-05-23 10:04:10', '2025-05-23 10:04:10'),
(67, 'YYuA-IcKjOEI1-XZg4', 102, 10, NULL, NULL, 35, 36, 'Medisio 36% Concentrate 10ML / Obat-Obatan / Sariawan', 'medisio-36-concentrate-10ml-obat-obatan-sariawan', '22467.00000000', 13302.00000000, 0, NULL, '0.00000000', '6830482c8b0b51747994668.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! Medisio 36% Concentrate 10ML / Obat-Obatan / Sariawan</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Cara Pemakaian:Untuk pemakaian luar.Cara Penyimpanan:sejuk, kering, dan terhindar cahaya matahari langsung.Deskripsi:Cairan antiseptik mengandung policresulen yang dapat membantu mengurangi pruritus (gatal-gatal) dan keputihan, memiliki khasiat astringen (menciutkan selaput lendir), hemostatik (menghentikan pendarahan), mematikan floral patogen dalam organ kewanitaan, mempertahankan floral normal, serta memulihkan keasaman fisiologis organ kewanitaanDosis:Untuk hemostatis lokal: Digunakan langsung pada area yang luka. Untuk luka bakar: Larutkan obat dengan air menggunakan perbandingan 1:3 hingga 1:8. Untuk luka bakar luas: Dapat menggunakan konsentrat saja.Dosis dan Cara Pemakaian :-Mengatasi luka pada kulit:Luka berdarah: Dengan atau tanpa pengenceran yaitu 1 tetes Albothyl Concentrate tambahkan ke dalam 5 tetes air matang (1:5), teteskan pada kapas, kemudian usapkan pada luka dan tekan perlahan selama 1/2 (setengah) - 1 menit.-Membersihkan atau antiseptik Organ Intim Wanita:Encerkan 10-15 tetes dalam segelas air (200ml) atau 1/4 (seperempat) gayung, kemudian basuhkan larutan atau gunakan handuk kecil yang sudah dibasahi larutan tersebut untuk membersihkan organ intim wanita, lalu bilas dengan sisa cairan.-Mengatasi Ruam Popok:Gunakan 5 tetes yang ditambahkan ke dalam 30ml air bersih/air matang, aduk merata. Basahi kapas dengan larutan tersebut, lalu usapkan pada daerah kulit yang teriritasi (ruam).Efek Samping:Efek lokal pada daerah yang dioleskan : Rasa tidak enak, iritasi.Golongan:Obat KerasIndikasi/ Kegunaan:Hemostatik lokal. Pembersihan dan regenerasi jaringan pada luka bakar, luka, proses inflamasi kronik, lesi dekubitus, ulkus kruris, kondiloma akuminata, stomatitis aftosa.Kandungan/Komposisi:Tiap ml mengandung polikresulen 360 mgKemasan:DUS, 1 BOTOL PLASTIK @ 10 MLKontraindikasi / Jangan Digunakan:Penderita hipersensitif terhadap zat aktif polikresulen.Manufaktur:PT. FARATUNIE:DKL8821600341A1Perhatian Khusus:HARUS DENGAN RESEP DOKTER.- Hindari penggunaan sabun yang mengiritasi selama perawatan.Perlu Resep:YaNote :*Apabila pesanan sudah sampai mohon dapat dicek kelengkapannya serta kondisi produk yang diterima sebelum klik pesanan selesai*Pesanan yang sudah di klik selesai tidak bisa di batalkan dan di return dengan alasan apapun.*Mohon buat Video Unboxing saat paket Diterima & Dibuka, kami tidak menerima komplain jika barang rusak/salah/kurang tanpa Video Unboxing*Pengembalian tidak dapat diproses apabila segel produk sudah terbuka.*Pengecekan batch akan dilakukan untuk memastikan barang tersebut di beli dari Century Official Sore.*Dengan membeli produk di toko Century Official Store maka customer menyetujui prosedur ini.*Selamat berbelanja di Century Official Store</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '6830482c8b0b51747994668.jpg', NULL, NULL, 1, 5, 1, 1, 1, 0, 0.00000000, 220, NULL, 1, NULL, '2025-05-23 10:04:28', '2025-05-23 10:04:28'),
(68, 'n38j-pwtYrOCC-URU8', 102, 10, NULL, NULL, 35, 36, 'Kotak Obat 7 Hari Anti Bocor Kotak Pil Mingguan Portabel untuk Vitamin & Obat-obatan - Hitam', 'kotak-obat-7-hari-anti-bocor-kotak', '72000.00000000', 13286.00000000, 0, NULL, '0.00000000', '6830483e2c5301747994686.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! Kotak Obat 7 Hari Anti Bocor Kotak Pil Mingguan Portabel untuk Vitamin & Obat-obatan - Hitam</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Panduan MembeliFiturKotak penyimpanan memiliki bentuk yang ringan dan kompak, yang merupakan dispenser yang sempurna untuk membawa suplemen dan pil Anda saat bepergian.Kotak penyimpanan memiliki fungsi organizer pil 7 hari dan 3 kali sehari, sehingga mengelola pil mingguan Anda mudah. Dan mengadopsi desain pembagian independen, yang nyaman untuk klasifikasi dan penggunaan.Ini terbuat dari bahan plastik.Sangat cocok untuk rumah, kantor, perjalanan dan sebagainya.SpesifikasiBahan: PlastikSkenario Penggunaan: Kantor, Perjalanan, RumahFitur: 21 Kotak, Portabel, Organizer Pil MingguanDetail Ukuran:15.7 cm x 11.8 cm x 4 cmPaket Termasuk1 x Kotak Pil (Lainnya Tidak Termasuk)Catatan: Catatan: Catatan:1、Toko lokal dikirim dalam waktu 24 jam, Tersedia COD.2、Karena perbedaan antara monitor yang berbeda, gambar mungkin tidak mencerminkan warna sebenarnya dari item tersebut.3、Perkenankan perbedaan 1-2 cm karena pengukuran manual, terima kasih.4、harap membuat VIDIO UNBOXING saat membuka paket5、jika ada kendala rusak/kurang barang/pesanan tidak sesuai  harap jangan terburu buru memberi penilaian buruk、silakan hubungi layanan pelanggan untuk solusi yang memuaskan.Terima kasih！6、Silakan tinggalkan umpan balik 5 bintang jika anda puas dengan produk dan layanan kami, kami akan menghargainya (barang seperti yang dijelaskan 5 bintang, komunikasi 5 bintang, waktu Pengiriman 5 bintang).7、Terima kasih banyak telah mengunjungi toko kami, semoga Anda bahagia setiap hari!</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '6830483e2c5301747994686.jpg', NULL, NULL, 1, 952, 1, 1, 1, 0, 0.00000000, 720, NULL, 1, NULL, '2025-05-23 10:04:46', '2025-05-23 10:04:46');
