n di return dengan alasan apapun.*Mohon buat Video Unboxing saat paket Diterima & Dibuka, kami tidak menerima komplain jika barang rusak/salah/kurang tanpa Video Unboxing*Pengembalian tidak dapat diproses apabila segel produk sudah terbuka.*Pengecekan batch akan dilakukan untuk memastikan barang tersebut di beli dari Century Official Store.*Dengan membeli produk di toko Century Official Store maka customer menyetujui prosedur ini.*Selamat berbelanja di Century Official Store.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '6830487f5ca6c1747994751.jpg', NULL, NULL, 1, 3, 1, 1, 1, 0, 0.00000000, 630, NULL, 1, NULL, '2025-05-23 10:05:51', '2025-05-23 10:05:51'),
(72, 'Mf3o-YMM9f0bV-6wx1', 102, 10, NULL, NULL, 35, 36, 'RETICOR 0.025% CREAM ISI 15GR / TRETINOIN/ SALEP JERAWAT / OBAT-OBATAN SALEP JERAWAT', 'reticor-0025-cream-isi-15gr-tretinoin-salep', '24244.00000000', 11004.00000000, 0, NULL, '0.00000000', '683048910b4801747994769.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! RETICOR 0.025% CREAM ISI 15GR / TRETINOIN/ SALEP JERAWAT / OBAT-OBATAN SALEP JERAWAT</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>DeskripsiRETICOR CREAM merupakan obat jerawat yang mengandung Tretinoin. Obat ini digunakan untuk mengurangi jumlah jerawat dan mempercepat penyembuhan jerawat. Tretinoin merupakan retinoid yang bekerja dengan cara mempengaruhi pertumbuhan pergantian sel kulit. Dalam penggunaan obat ini HARUS SESUAI DENGAN PETUNJUK DOKTER.Indikasi UmumAkne vulgaris. Meredakan komedo, papul dan pustulKomposisiTretinoin (Retinoic Acid) 0.025%Efek SampingKulit kemerahan, hiperpigmentasi atau hipopigmentasi, fotosensitivitasBentuk SediaanKrimProdusenGenero PharmaceuticalNo BPOMBPOM: DKL0635802129A1Golongan ObatObat Keras (Merah) Aturan PakaiOleskan pada bagian kulit atau bagian yang sakit sesuai dengan aturan pakai. Jangan digunakan untuk luka terbuka kecuali obat memang diperuntukkan pada luka terbuka Obat Keras (Merah)</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '683048910b4801747994769.jpg', NULL, NULL, 1, 95, 1, 1, 1, 0, 0.00000000, 240, NULL, 1, NULL, '2025-05-23 10:06:09', '2025-05-23 10:06:09'),
(73, '0TlC-yuYOPrrT-ZMlo', 102, 10, NULL, NULL, 35, 36, 'CLIDACOR 1% GEL 10GR / CLINDAMYCIN GEL/ OBAT OBATAN SALEP', 'clidacor-1-gel-10gr-clindamycin-gel-obat', '26640.00000000', 12026.00000000, 0, NULL, '0.00000000', '683048a4a1eb81747994788.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! CLIDACOR 1% GEL 10GR / CLINDAMYCIN GEL/ OBAT OBATAN SALEP</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>DeskripsiCLIDACOR GEL merupakan obat dengan kandungan antibiotik clindamycin. Obat ini digunakan untuk akne vulgaris, terutama lesi inflamasi yang disertai pustula (jerawat dengan cairan atau nanah). Clindamycin adalah antibakteri lincosamide yang memiliki aksi bakteriostatik terhadap bakteri gram positif. Clindamycin menghambat fase awal sintesis protein dengan berikatan pada 50 S sub unit ribosom bakteri.Indikasi UmumAkne vulgaris, terutama lesi inflamasi yang disertai pustula (jerawat dengan cairan atau nanah).KomposisiClindamycin PhosphateDosisOleskan tipis-tipis 1 kali sehari.Aturan PakaiDioleskan tipis-tipisPerhatianSebaiknya tidak digunakan pada individu yang memiliki riwayat ulcerative colitis atau enteritis, dan riwayat diare berat akibat antibiotik.Kontra IndikasiHipersensitif terhadap clindamycin atau lincomycin, riwayat ulcerative colitis atau enteritis.Efek SampingPemakaian obat umumnya memiliki efek samping tertentu dan sesuai dengan masing-masing individu. Jika terjadi efek samping yang berlebih dan berbahaya, harap konsultasikan kepada tenaga medis. Efek samping yang mungkin terjadi dalam penggunaan obat adalah: Kulit kering, kulit kemerahan, urtikaria (biduran), diare.KemasanDus, Tube @ 10 gramManufakturGenero PharmaceuticalNo. RegistrasiBPOM: DKL0835803228A1Note :*Apabila pesanan sudah sampai mohon dapat dicek kelengkapannya serta kondisi produk yang diterima sebelum klik pesanan selesai*Pesanan yang sudah di klik selesai tidak bisa di batalkan dan di return dengan alasan apapun.*Mohon buat Video Unboxing saat paket Diterima & Dibuka, kami tidak menerima komplain jika barang rusak/salah/kurang tanpa Video Unboxing*Pengembalian tidak dapat diproses apabila segel produk sudah terbuka.*Pengecekan batch akan dilakukan untuk memastikan barang tersebut di beli dari Century Official Store.*Dengan membeli produk di toko Century Official Store maka customer menyetujui prosedur ini.*Selamat berbelanja di Century Official Store.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '683048a4a1eb81747994788.jpg', NULL, NULL, 1, 2, 1, 1, 1, 0, 0.00000000, 260, NULL, 1, NULL, '2025-05-23 10:06:28', '2025-05-23 10:06:28'),
(74, 'Tj8I-hZzeB8UZ-YUE9', 102, 10, NULL, NULL, 35, 36, 'PROXIDIL 5% 30ML / OBAT-OBATAN / MINOXIDIL', 'proxidil-5-30ml-obat-obatan-minoxidil', '99068.00000000', 11848.00000000, 0, NULL, '0.00000000', '683048b6a63b71747994806.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! PROXIDIL 5% 30ML / OBAT-OBATAN / MINOXIDIL</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>DKL2134616041A1DeskripsiPENGGUNAAN OBAT INI HARUS SESUAI PETUNJUK DOKTER. Digunakan untuk pengobatan androgenetic alopecia (pola kerontokan rambut) pada bagian atas kulit kepala (vertex) dan alopecia aerata.Indikasi / KegunaanUntuk terapi androgenetic alopecia (pola kerontokan rambut) pada bagian atas kulit kepala (vertex) dan alopecia aerata.Kandungan / KomposisiTiap ml mengandung minoxidilDosisATURAN PAKAI HARUS SESUAI DENGAN PETUNJUK DOKTER. Dioleskan dua kali sehari ke kulit kepala. Dosis harian total tidak boleh melebihi 2 ml, kecuali jika diarahkan oleh dokter. Dosis ini harus digunakan terlepas dari ukuran area yang terkenaCara PemakaianUntuk pemakaian luarKontraindikasi / Jangan digunakan olehPasien dengan HTN yang diobati atau tidak diobati, kelainan kulit kepala (misalnya psoriasis, terbakar sinar matahari), kulit kepala yang dicukur.Efek SampingDermatitis kontak, pruritus, pembakaran lokal, kemerahan, perubahan warna atau tekstur rambut.Perhatian KhususHati-hati penggunaan pada pasien dengan riwayat HTN paru, angina pektoris, gagal jantung kronis, MI baru-baru ini. Gangguan ginjal. Lansia, childn. Kehamilan dan menyusui.Cara PenyimpananSimpan pada tempat sejuk dan kering, serta terlindung dari cahayaNote :*Apabila pesanan sudah sampai mohon dapat dicek kelengkapannya serta kondisi produk yang diterima sebelum klik pesanan selesai*Pesanan yang sudah di klik selesai tidak bisa di batalkan dan di return dengan alasan apapun.*Mohon buat Video Unboxing saat paket Diterima & Dibuka, kami tidak menerima komplain jika barang rusak/salah/kurang tanpa Video Unboxing*Pengembalian tidak dapat diproses apabila segel produk sudah terbuka.*Pengecekan batch akan dilakukan untuk memastikan barang tersebut di beli dari Century Official Sore.*Dengan membeli produk di toko Century Official Store maka customer menyetujui prosedur ini.*Selamat berbelanja di Century Official Store.</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '683048b6a63b71747994806.jpg', NULL, NULL, 1, 3, 1, 1, 1, 0, 0.00000000, 990, NULL, 1, NULL, '2025-05-23 10:06:46', '2025-05-23 10:06:46'),
