(78, 'XE9P-uSnprJRH-mP98', 102, 10, NULL, NULL, 39, 40, 'SPEEDS Elbow Supporter Pelindung Pegelangan Tangan Sikut Perlengkapan Fitness 053-3 - UKURAN L', 'speeds-elbow-supporter-pelindung-pegelangan-tangan-sikut', '20000.00000000', 17832.00000000, 0, '18000.00000000', '10.00000000', '68304901902611747994881.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! SPEEDS Elbow Supporter Pelindung Pegelangan Tangan Sikut Perlengkapan Fitness 053-3 - UKURAN L</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Elbow Supporter adalah Perlengkapan perlindungan yang berfungsi untuk melindungi lengan atau siku dari goresan atau luka saat latihan, aktivitas atau saat berolahraga. Elbow supporter juga berguna untuk mengurangi rasa sakit atau nyeri yang diakibatkan otot pegal atau otot tertarik saat latihan, atau olahraga seperti badminton atau basket. Elbow supporter ini cocok digunakan untuk segala macam jenis olahraga. Terbuat dari bahan nilon, spandex dan katun. Elbow supporter ini berukuran L atau XLFeatures~Didesain khusus untuk kebebasan dalam bergerak~Pelindung siku ini memiliki pori pori sehingga tidak telalu panas saat dipakai~Berfungsi untuk melindungi siku dari pori pori</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '68304901902611747994881.jpg', NULL, NULL, 1, 2, 1, 1, 1, 0, 0.00000000, 200, NULL, 1, NULL, '2025-05-23 10:08:01', '2025-05-23 10:08:01'),
