(106, '0zFn-4WFVZnX9-AOFG', 102, 10, NULL, NULL, 52, 53, 'Tongkat Jari Penunjuk Baca Buku Anak Sekolah Tunjuk Papan Tulis Panjang 68 cm Alat bantu Mengajar / Teleskopik Pointer Untuk Mengajar - tongkat penunjuk', 'tongkat-jari-penunjuk-baca-buku-anak-sekolah', '25000.00000000', 11931.00000000, 0, '10000.00000000', '60.00000000', '68304b2d573cf1747995437.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! Tongkat Jari Penunjuk Baca Buku Anak Sekolah Tunjuk Papan Tulis Panjang 68 cm Alat bantu Mengajar / Teleskopik Pointer Untuk Mengajar - tongkat penunjuk</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>*Ukuran Produk:Penunjuk teleskopik kami dirancang dengan desain yang dapat ditarik, dapat diperpanjang hingga 68cm dan ditarik kembali hingga 21.3cm, dapat ditarik secara fleksibel tanpa goyang, Anda dapat menyesuaikan panjangnya secara fleksibel sesuai permintaan.* Aman dan tahan lama:pegangan teleskopik dari tongkat penunjuk yang dapat ditarik terbuat dari baja tahan karat berkualitas tinggi. Permukaan halus pada bagian tangan dan jari menjamin keamanan, sedangkan pegangan anti slip memberikan pegangan yang nyaman.*Desain Menarik:penunjuk kami yang dapat diperpanjang terinspirasi oleh bentuk jari, dengan warna yang mencolok dan bentuk yang unik, yang dapat menarik perhatian anak-anak, merangsang imajinasi mereka dan membuat pembelajaran menjadi menyenangkan dan interaktif.*warna acak:biru, merah muda, ungu, kuning, dan hijau, menambah kegembiraan dan daya tarik visual ke ruang kelas Anda. Anda dapat meningkatkan aktivitas kelas dan membuat anak tetap terlibat dengan tongkat penunjuk warna-warni dan dapat diperpanjang ini. Tongkat penunjuk jari juga dapat digunakan untuk membaca, bermain peran, memimpin musik, presentasi, partisipasi di kelas, dan banyak lagi.* Banyak digunakan:penunjuk jari ini dapat digunakan sebagai perlengkapan pengajaran di kelas, di rumah, perlengkapan pengajaran kegiatan di luar ruangan, sangat cocok untuk pengajaran guru maupun orang tua, pelatihan konferensi, pidato, ceramah, ruang pameran untuk menjelaskan, dll. adalah alat bantu mengajar yang ideal.-Umum:. Sebelum mengirim barang akan kami cek terlebih dahulu (QC).. Kami tidak akan mengirimkan barang yang rusak atau bekas.. Tidak dapat mengubah pesanan/alamat kecuali repeat order.-Keluhan & Pengembalian:. Harap lakukan video unboxing dan cek barang sebelum klik terima pesanan di aplikasi.. Komplain tanpa video unboxing dan bukti foto tidak akan kami terima.. Jika pembeli ingin mengembalikan atau mengganti barang setelah pesanan selesai, biaya pengiriman akan sepenuhnya ditanggung oleh pembeli. Kami dengan senang hati menerima kritik, saran dan keluhan melalui chat.UNTUK BARANG PECAH BELAH WAJIB ORDER BUBBLE WRAP YAAAAA AGAR BARANG TETAP AMAN SAMPAI TEMPAT TUJUAN KALIANPACKINGAN TIDAK MEMAKAI BUBBLE WARPApabila ingin paket aman tambahkan bubble ke dalam pesananSemua paket yang sudah di serahkan ke expedisi menjadi tanggung jawab antara Customer dengan Pihak ExpedisiUntuk paket tidak pesan bubble, maka jika barang sampai rusak / pecah bukan menjadi tanggung jawab sellerProduk Impor 100% Tangan PertamaMenerima Dropship/Reseller/WholesaleIkuti toko kami untuk info DISKON dan PRODUK BARU !</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '68304b2d573cf1747995437.jpg', NULL, NULL, 1, 1, 1, 1, 1, 0, 0.00000000, 250, NULL, 1, NULL, '2025-05-23 10:17:17', '2025-05-23 10:17:17'),
(107, '4mWy-rgslrIJA-xqpy', 102, 10, NULL, NULL, 52, 53, 'Buku Pendidikan Olimpiade Sains Nasional Matematika IPA OSN Sekolah Dasar SD Siswa / Pustaka Baru Press - PB - OSN SD IPA', 'buku-pendidikan-olimpiade-sains-nasional-matematika-ipa', '60000.00000000', 19330.00000000, 0, NULL, '0.00000000', '68304b3fcfcd21747995455.jpg', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Best Seller Produk Kami! Buku Pendidikan Olimpiade Sains Nasional Matematika IPA OSN Sekolah Dasar SD Siswa / Pustaka Baru Press - PB - OSN SD IPA</p></body></html>\n', '<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><head><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"></head><body><p>Buku Pendidikan Olimpiade Sains Nasional Matematika Dan IPA OSN Sekolah Dasar SD ( Berisi Gabungan Soal2 OSN Dan KSN Terbaru Terupdate )Olimpiade Sains Nasional adalah ajang berkompetisi dalam bidang sains bagi para siswa pada jenjang SD, SMP, dan SMA di Indonesia. Siswa yang mengikuti Olimpiade Sains Nasional adalah siswa yang telah lolos seleksi tingkat kabupaten dan provinsi dan adalah siswa-siswa terbaik dari provinsinya masing-masing.Pelaksanaan Olimpiade Sains Nasional ini didasarkan pada kesuksesan Indonesia sebagai tuan rumah Olimpiade Fisika Internasional (IPhO - International Physics Olympiad) yang diselenggarakan di Bali pada tahun 2002.1. OSN IPA SDPenerbit : Pustaka Baru PressDimensi : 18 x 26 cmKetebalan : 176 halamanBookpaper.(Terbit 2025)Buku ini berisi :- ringkasan materi yang jelas dan praktis.- bank soal OLIMPIADE SAINS NASIONAL terlengkap, baik tingkat KOTA, KABUPATEN, PROVINSI maupun NASIONAL.- full pembahasan xtra lengkap dan jelas.2. OSN MATEMATIKA SDBuku ini siap menjadi teman kamu menggapai prestasi dan siap hadapi OSN Matematika.lsinya SUPER LENGKAP dan SUPER KOMPLET.- Ringkasan materi yang jelas dan praktis.- BANK SOAL OLIMPIADE SAINS NASIONAL Matematika terlengkap; baik lingkat KABUPATEN, PROVINSI, maupun NASIONAL.- FULL Pembahasan X-tra Lengkap dan Jelas.Buku yang kamu pegang ini siap jadi pendamping untuk persiapan hadapi OSN Matematika.Spesifikasi :Judul : Siap Juara OSN MATEMATIKA SDPenulis : Tim Pustaka Cerdas(Terbit 2025)Penerbit : Pustaka BaruJumlah Halaman : 135Dimensi : SC, 18x26cmOlimpiade Sains Nasional diadakan sekali dalam satu tahun di kota yang berbeda-beda. Kegiatan ini merupakan salah satu bagian dari rangkaian seleksi untuk mendapatkan siswa-siswi terbaik dari seluruh Indonesia yang akan dibimbing lebih lanjut oleh tim bidang kompetisi masing-masing dan akan diikutsertakan pada olimpiade-olimpiade tingkat internasional.Untuk produk-produk lainnya, silahkan cek etalase di toko kamiProduk kami dijamin ASLI dan ORIGINALPacking aman dan rapiPastikan Anda follow toko kami untuk mendapatkan voucher dan promo menarikChat kami untuk menanyakan produk kamiMohon beri ulasan dan rating bintang 5 ya!Jangan lupa membuat Video Unboxing ya!Karena kami tidak akan memproses komplain tanpa ada bukti video unboxingSELAMAT BELANJA :)</p></body></html>\n', NULL, '[\"18\"]', '1', '[{\"attribute_id\":\"18\",\"values\":[\"tidak-ditentukan\"]}]', NULL, '68304b3fcfcd21747995455.jpg', NULL, NULL, 1, 1, 1, 1, 1, 0, 0.00000000, 600, NULL, 1, NULL, '2025-05-23 10:17:35', '2025-05-23 10:17:35');
